import React from 'react';
import { Provider } from 'react-redux'
import './App.css';
import TodoApp from './Componets/Lesson1/TodoApp/'
import TodoApp2 from './Componets/Lesson2/TodoApp/'
import store from './Stores/todo'


class App extends React.Component {
  render() {
    return (
      <Provider store = {store}>
        <TodoApp2 />
      </Provider>
    )
  }
}

export default App;
